import React from 'react';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';
import { signOut } from '../store/actions/authAction';
import '../App.css';
import logo from '../image/postman-logo.svg';
import Sidebar from './Sidebar';
import { Redirect } from 'react-router-dom';
import HttpRequest from './HttpRequest';
import { firestoreConnect } from 'react-redux-firebase';
import { compose } from 'redux';

const Dashboard = (props) => {
  const { auth, history } = props;
  console.log('users####', (history));
  // const his = Object.values(history)

  // console.log('ahfbjsadk', props)
  if (!auth.uid) return <Redirect to="/" />;
  return (
    <main>
      <div className="postmanImage">
        <img id="logo" src={logo} alt="postman-logo" />
        <Link to={'/'}>
          <button onClick={props.signOut} className="signoutButton">
            Signout
          </button>
        </Link>
      </div>
      <div className="sidebarAndHttpRequestContainer">
        <section className="sidebar">
          <Sidebar history={history} />
        </section>
        <section className="httpRequest">
          <HttpRequest />
        </section>
      </div>
    </main>
  );
};
// }
const mapStateToProps = (state) => {
  return {
    auth: state.firebase.auth,
    history: state.firestore.data.history
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    signOut: () => dispatch(signOut())
  };
};

export default compose(
  connect(
    mapStateToProps,
    mapDispatchToProps
  ),
  firestoreConnect([{ collection: 'history' }])
)(Dashboard);
